import React from 'react'
import Link from 'next/link';
class Juicy extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div>
        <p>Hey jude</p>
        <Link href='/about' >about page</Link>
      </div>
    )
  }
}
export default Juicy
